class Solution:
    def maxVowels1(self, s: str, k: int) -> int:
        vowel = {'a','e','i','o','u'}
        maxVowels = 0
        for all_windows in range(len(s) - k+1):
            currentVowels = 0
            for letter in s[all_windows:all_windows + k]:
                if vowel.intersection({letter}):
                    currentVowels+=1
            if currentVowels > maxVowels:
                maxVowels= currentVowels
        return maxVowels

    def maxVowels2(self, s: str, k: int) -> int:
        max_vowel = 0
        vowel = {'a', 'e', 'i', 'o', 'u'}
        word_list =list(s)
        for i in range(len(word_list)):
            if vowel.intersection({word_list[i]}):
                word_list[i] = 1
            else:
                word_list[i] = 0
        for all_windows in range(len(word_list) - k+1):
            current_vowels = sum(word_list[all_windows:all_windows + k])
            if current_vowels > max_vowel:
                max_vowel = current_vowels
        return max_vowel

    def maxVowels(self, s: str, k: int) -> int:
        word_list =list(s)
        vowel = {'a', 'e', 'i', 'o', 'u'}
        for i in range(len(word_list)):
            if vowel.intersection({word_list[i]}):
                word_list[i] = 1
            else:
                word_list[i] = 0
        max_sum = 0
        for i in range(k):
            max_sum += word_list[i]
        curr_sum = max_sum
        for i in range(k, len(word_list)):
            curr_sum += word_list[i] - word_list[i - k]
            max_sum = max(max_sum, curr_sum)
        return max_sum




